export function CartItem({ date, onCountUp, onCountDown, onDelete }) {
  return (
    <div className="col-md-6">
      <div className="row">
        <div classame="col-md-6">
          <div className="row">
         
          {
                        date.map(elm => {
                            return <ProductItem
                                {...elm}
                                />

                        })
                    }
          
         
          </div>
        </div>
      </div>
    </div>
  );
}
